import React, { Component , Fragment } from "react";

          class Difference extends Component{
              state = {
                  didViewCountUp: false
              };
              onVisibilityChange = isVisible => {
                  if (isVisible) {
                      this.setState({didViewCountUp: true});
                  }
              }
              render(){
                  let Data = [
                      {
                          title : 'Disponibilité',
                          countTitle: 'Nous sommes réactifs, prenons le temps  d’écouter , comprendre et  répondre aux questions de nos clients, les rassurer et les accompagner dans leurs démarches. ',
                      },
                      {
                        title : 'Professionnalisme',
                        countTitle: 'See the AI in action and learn more about our application.',
                      },
                      {
                          title : 'Schedule a briefing',
                          countTitle: 'Meet the DNA GA team in person and see what it\'s to work with us. ',

                      },
                  ];

                  return(
                      <Fragment>
                      <br/>

                          <div className=" row">
                              {Data.map( (value, i) => (
                                  <div className="col-lg-4 col-md-4 col-sm-6 col-12" key={i}>
                                      <h3 style={{color:'white'}}>{value.title}</h3>
                                      <p className="description"style={{color:'white'}}>{value.countTitle}</p>

                                  </div>
                              ))}
                          </div>
                      </Fragment>
                  )
              }
          }

